import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
    width: 30%;
`

function TechnologyCard(tech) {
  return (
    <Container>
        <img src={tech.image} alt={tech.title}/>
        <h3>{tech.title}</h3>
        <p>{tech.description}</p>
    </Container>
  )
}

export default TechnologyCard
